import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DynamicForm = () => {
    const [columns, setColumns] = useState([]);
    const [selectedFilters, setSelectedFilters] = useState({
        // Initialize date range with empty strings
        dobFrom: '',
        dobTo: ''
    });

    useEffect(() => {
        // Fetch list of columns from the backend
        axios.get('/api/dynamic-form')
            .then(response => {
                setColumns(response.data.columns);
            })
            .catch(error => {
                console.error('Error fetching columns:', error);
            });
    }, []);

    const handleFilterChange = (columnName, value) => {
        // Update selected filters when the user selects a filter
        setSelectedFilters(prevFilters => ({
            ...prevFilters,
            [columnName]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault(); // Prevent default form submission behavior
        // Handle form submission and send selected filters to the backend
        axios.post('/api/dynamic-form', selectedFilters)
            .then(response => {
                console.log('Filters saved successfully:', response.data.message);
            })
            .catch(error => {
                console.error('Error saving filters:', error);
            });
    };

    // Options provided for each filter
    const options = {
        Status: ['Active', 'Serving Notice', 'Resigned'],
        Type: ['Permanent', 'Probation', 'Contract'],
        'Notice Period': ['30 Days', '45 Days', '60 Days', '90 Days'],
        'Work Location': ['CSEZ', 'Home', 'Onsite', 'Eazylearn'],
        'Primary Skill': ['ASP.Net', 'PHP', 'SQL Server', 'MERN', 'MEAN', 'Fullstack', 'AI', 'Data Science', 'Java', 'React JS', 'React Native', 'Excel', 'IIB', 'UI', 'Project Office'],
        Gender: ['Male', 'Female', 'Others'],
        'Marital Status': ['Single', 'Married', 'Widow', 'Widower', 'Divorced', 'Separated'],
        'Blood Group': ['A+', 'A-', 'B+', 'B-', 'AB+', 'AB-', 'O+', 'O-', 'K', 'Not Known'],
        'Work Timing': ['9:30 AM - 6:30 PM', '4:00 AM - 1:00 PM', '4:00 PM - 1:00 AM'],
        Flexibility: ['30 Minutes', '45 Minutes'],
        Weekday: ['MON', 'TUE', 'WED', 'THU', 'FRI', 'SAT', 'SUN']
    };

    return (
        <div className="container">
            <div className="row">
                <div className="col-md-8 offset-md-2">
                    <div className="dynamic-form">
                        <h2 className="text-center mb-4">Dynamic Form</h2>
                        <form onSubmit={handleSubmit}>
                            {columns.map(column => (
                                <div key={column.filterName} className="form-group row">
                                    <label htmlFor={column.filterName} className="col-sm-3 col-form-label">{column.filterName}</label>
                                    <div className="col-sm-9">
                                        {column.filterName === 'Date of Birth' ? (
                                            <div className="row">
                                                <div className="col-sm-6">
                                                    <input type="date" className="form-control" placeholder="From" value={selectedFilters.dobFrom} onChange={(e) => handleFilterChange('dobFrom', e.target.value)} />
                                                </div>
                                                <div className="col-sm-6">
                                                    <input type="date" className="form-control" placeholder="To" value={selectedFilters.dobTo} onChange={(e) => handleFilterChange('dobTo', e.target.value)} />
                                                </div>
                                            </div>
                                        ) : (
                                            <select id={column.filterName} name={column.filterName} className="form-control" onChange={(e) => handleFilterChange(column.filterName, e.target.value)}>
                                                <option value="">Select filter...</option>
                                                {options[column.filterName].map(option => (
                                                    <option key={option} value={option}>{option}</option>
                                                ))}
                                            </select>
                                        )}
                                    </div>
                                </div>
                            ))}
                            <div className="text-center">
                                <button type="submit" className="btn btn-primary mt-4">Save</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default DynamicForm;
